import React from "react";

const Dashboard = () => {
  return (
    <div>
      <h1 className="display-1">Welcome to FleetBuddy.</h1>
      <h1>
        Please use links available in the Navbar to access the application
      </h1>
    </div>
  );
};

export default Dashboard;
